import React from "react";
import { Button } from "reactstrap";
import "./css-components/nav-bar.css";

function Navbar() {
  return (
    <div className="bar">
      <Button color="danger">Danger!</Button>
      <img src="errandslogo.png" />
    </div>
  );
}

export default Navbar;
